import React, { Component } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';

class Table extends Component {
    constructor() {
        super()
        this.state = {}
    }

    render(){
        return(
            <table>
        <thead>
          <tr>
              <th>Name</th>
              <th>Owes</th>
          </tr>
        </thead>

        <tbody>
          <tr>
            <td>Alvin</td>
            <td>Eclair</td> 
          </tr>
          <tr>
            <td>Alan</td>
            <td>Jellybean</td>
          </tr>
          <tr>
            <td>Jonathan</td>
            <td>Lollipop</td>
          </tr>
        </tbody>
      </table>
        )
    }
}

export default Table
